import React from 'react';
import { Navbar, Button, Nav, ButtonGroup } from 'react-bootstrap';
import {Image} from "semantic-ui-react";
import ButtonToolbar from "react-bootstrap/ButtonToolbar";
import styles from '../../Assets/global-styles/bootstrap.min.css';
class NavbarBootstrap extends React.Component {

    render (){
        return (
            <Navbar collapseOnSelect expand="sm" bg="dark" variant="dark">
                <Navbar.Brand>
                    <img
                        src='./../../img/MatchApp-Logo.png'
                        height="50"
                        alt="MatchApp Logo"
                    />
                </Navbar.Brand>
                <Navbar.Toggle/>
                <Navbar.Collapse>
                    <Nav className={styles.mr-auto}>
                        <Nav.Link>Wall</Nav.Link>
                        <Nav.Link>Profile</Nav.Link>
                        <Nav.Link>Messages</Nav.Link>
                        <Nav.Link>Notifications</Nav.Link>
                    </Nav>
                    <Nav>
                        <ButtonToolbar>
                            <ButtonGroup className="mt-3 mb-3">
                                <Button size="md" variant="outline-primary">Log in</Button>
                                <Button variant="outline-primary">Sign up</Button>
                            </ButtonGroup>
                        </ButtonToolbar>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default NavbarBootstrap;
// id="responsive-navbar-nav"
